THE HIGH CHAPARRAL -1x21- CHAMPION OF THE WESTERN WORLD (2/4/1968)

Billy Blue Cannon plans to earn money for an expensive silver saddle by boxing. Killian and his ranch hands have entered every event in the Fourth of July rodeo to win the saddle. Desperate for funds, Blue works out for five dollars with champion Paddy O&amp;#039;Bannion&amp;#039;s opponent, but breaks the man&amp;#039;s jaw. Buck convinces Blue he must fight the champ to earn the money, but Blue&amp;#039;s feelings waver when he learns O&amp;#039;Bannion needs the fight money in order to marry.

